v8:item.v8:content:
Доходы, в отношении которых применяется налоговая ставка, предусмотренная пунктом 1 статьи 224 Кодекса:
- доходы по операциям с ценными бумагами и по операциям с производными финансовыми инструментами (за исключением доходов по коду «04»);
- доходы по операциям РЕПО, объектом которых являются ценные бумаги;
- доходы по операциям займа ценными бумагами;
- доходы, полученные участниками инвестиционного товарищества;
- доходы по операциям с ценными бумагами и операциям с производными финансовыми инструментами, учитываемым на индивидуальном инвестиционном счете

Доходы, в отношении которых применяется налоговая ставка, предусмотренная пунктом 1 статьи 224 Кодекса:
- доходы в виде процента (купона, дисконта), получаемые по обращающимся облигациям российских организаций, номинированные в рублях и эмитированным после 01.01.2017;
- доходы в виде суммы процентов по государственным казначейским обязательствам, облигациям и другим государственным ценным бумагам бывшего СССР, государств - участников Союзного государства

Доходы, в отношении которых применяется налоговая ставка, установленная пунктом 1.1 статьи 224 Кодекса:                                                                                                                     
- доходы в виде стоимости имущества (за исключением ценных бумаг), полученного в порядке дарения;
- подлежащие налогообложению доходы, полученные в виде страховых выплат по договорам страхования и выплат по пенсионному обеспечению

Доходы, в отношении которых применяется налоговая ставка, предусмотренная пунктом 2 статьи 224 Кодекса:
- доходы в виде стоимости любых выигрышей и призов, получаемых в проводимых конкурсах, играх и других мероприятиях в целях рекламы товаров, работ и услуг, в части превышения размеров, указанных в пункте 28 статьи 217 Кодекса;
- доходы в виде суммы экономии на процентах при получении налогоплательщиками заемных (кредитных) средств в части превышения размеров, указанных в пункте 2 статьи 212 Кодекса;
- доходы в виде платы за использование денежных средств членов кредитного потребительского кооператива (пайщиков), а также процентов за использование сельскохозяйственным кредитным потребительским кооперативом средств, привлекаемых в форме займов от членов сельскохозяйственного кредитного потребительского кооператива или ассоциированных членов сельскохозяйственного кредитного потребительского кооператива, налоговая база по которым определяется в соответствии со статьей 214.2.1 Кодекса

Доходы, в отношении которых применяется налоговая ставка, предусмотренная пунктом 5 статьи 224 Кодекса:
- доходы в виде процентов по облигациям с ипотечным покрытием, эмитированным до 01.01.2007;
- доходы учредителей доверительного управления ипотечным покрытием, полученным на основании приобретения ипотечных сертификатов участия, выданных управляющим ипотечным покрытием до 01.01.2007

Доходы, в отношении которых применяется налоговая ставка, предусмотренная пунктом 1 статьи 224 Кодекса:
- доходы по операциям с ценными бумагами и по операциям с производными финансовыми инструментами (за исключением доходов по коду «04»);
